import React from "react";
import style from './MealItemForm.module.css';
import Input from "../../UI/Input";

const MealItemForm=(props)=>{
    return(
      <React.Fragment>
      <form className={style.form}>
        <Input name={props.id}/>
        <button>+ Add</button>
      </form>
      </React.Fragment>
    );
}

export default MealItemForm;
